text:
Outback parkshoping que sempre elogiei hoje deixou aquele sentimento de que era melhor ter ficado em casa e de que fui lesado .
O atendimento dos garçons é sempre bom , mas precisam ter mais cuidado com o que servem ;
A costela veio com...Mais

Poderia morar nesse local SE:

- os preços fossem mais acessíveis;
- o atendimento não ficasse complicado em finais de semanas e feriados (fica muito ruim);
- e a fila de espera não fosse quase "eterna" (já desisti algumas vezes de comer no local devido...Mais
